import styles from "./Poster.module.scss";
const PosterComponent = () => {
	return (
		<div className={styles.cardContainer}>
			<div className={styles.card}>
				<h2>{"title"}</h2>
				<p>{"content"}</p>
			</div>
		</div>
	);
};
export default PosterComponent;
